My Sisters Hot Friend - Jayden Cole &amp; Eden Adams 

May 9, 2011

Eden is leaving for her European vacation and her flight is delayed which makes her even more nervous. She is visiting an old friend there that she hasn't seen for a few years. Jayden comes home to check on her, and while they are talking.....finds a magic wand in her carry-on. It seems Eden had a fling with her european girlfriend. This turns Jayden on immensely, one thing leads to another, and suddenly the girls are making love to each other!
